import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
import Data from './components/Data';
import Resources from './components/Resources';
import LightOnPACE from './components/LightOnPACE';
import DataAccess from './components/DataAccess';
import PhytoplanktonExploration from './components/PhytoplanktonExploration';
import BuildYourRhythm from './components/BuildYourRhythm';
import WhyWeNeedPACE from './components/WhyWeNeedPACE';
import LatestNews from './components/LatestNews';
import StoryMaps from './components/StoryMaps';
import MediaGallery from './components/MediaGallery';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/acerca-de" component={About} />
        <Route path="/datos" exact component={Data} />
        <Route path="/datos/arrojando-luz" component={LightOnPACE} />
        <Route path="/datos/acceso" component={DataAccess} />
        <Route path="/datos/exploracion-fitoplancton" component={PhytoplanktonExploration} />
        <Route path="/datos/ritmo" component={BuildYourRhythm} />
        <Route path="/datos/por-que-necesitamos-pace" component={WhyWeNeedPACE} />
        <Route path="/datos/ultimas-noticias" component={LatestNews} />
        <Route path="/datos/mapas" component={StoryMaps} />
        <Route path="/datos/galeria" component={MediaGallery} />
        <Route path="/recursos" component={Resources} />
      </Switch>
    </Router>
  );
}

export default App;
